import React from 'react';
import { LoadingIndicator } from './styledComponents/Loading';

const Loading = () => {
  return (
    <div style={{display: 'flex', justifyContent: 'center'}}>
      <LoadingIndicator />
    </div>
  );
};

export default Loading;
